en:
The qualification holder is able to:
(1) function confidently in digital cultures; 
(2) understand the history and theory of new media; 
(3) recognise social media and user practices as e.g. net activism and hacking; 
(4) apply problem based learning; 
(5) analyse discourse; 
(6) write for a research weblog and apply basic programming skills.

The qualification holder is able to:
(1) understand three relevant philosophical positions; 
(2) apply phenomenological analysis of media.

The qualification holder is able to:
(1) understand the changes in the production and consumption of music related to the societal appropriation of new sound technologies; 
(2) problematise the relationship between sound technologies and cultural practices.

The qualification holder is able to:
(1) understand the impact of old and new media on the structural transformation of the public sphere;
(2) reflect on core problems of public spheres, such as democratic deficits, unequal power relations, censorship, the tyranny of intimacy and the limits of hacktivism;
(3) write a research paper.

The qualification holder is able to:
(1) understand the logics of datafication and the ideologies of sharing through digital media; 
(2) critically assess online sharing practices with a specific focus on ethical issues emerging from these new practices.

The qualification holder is able to:
(1) phrase research questions and design a research plan; 
(2) peer-review a research proposal.

The qualification holder is able to:
(1) engage in independent, in-depth research; 
(2) further deepen their knowledge of a specific field in media culture.

The qualification holder is able to:
(1) improve their professional skills; 
(2) meet and interact with representatives of the professional field.

The qualification holder is able to:
(1) reflect on the practical part of the internship and its evaluation; 
(2) present and discuss the relation of the professional field to the academic part of the MAMC programme.
